let items = [
	{
		id: 1,
		name: 'God of Blade',
		power: '1000'
	},
	{
		id: 2,
		name: 'Supreme Dagger',
		power: '1200'
	},
	{
		id: 3,
		name: 'Hollow Axes',
		power: '1300'
	},
]

export function getItems() {
	return items;
}
